import React from "react";
import { Circle } from "react-konva";
import { connect } from "react-redux";

class LoopInterval extends React.Component {
  render() {
    return (
      <Circle
        x={this.props.x}
        y={this.props.y}
        offset={this.props.offset}
        radius={20}
        fill={"#fcf6ec"}
        stroke={"#ed1e79"}
        //strokeWidth={this.props.radius / 100}
        strokeWidth={1.5}
      />

    );
  }
}

export default connect()(LoopInterval);
